function YourComponent() {
  return (
    <div className="containerClient">
      <div className="spacer"></div>
      <div className="boxClient">
        <h2>Clients</h2>
        {/* Content for the Clients box */}
      </div>
      <div className="spacer"></div>
      <div className="boxClient">
        <h2>Companies</h2>
        {/* Content for the Companies box */}
      </div>
      <div className="spacer"></div>
    </div>
  );
}

export default YourComponent;
